import React from "react"
import s from "./Author.module.css"

const Author = () => {
    return (
        <div className={s.Author}>
            <div className={s.image}>
                <image src={url("images/sun.jpg")}/>
            </div>
            <div className={s.text}>world</div>
        </div>
    )
}

export default Author;
